import logo from "./logo.svg";
import "./App.css";
import Nav from "./frontend/homepage/Nav";
import Homepage from "./frontend/homepage/Homepage";
import { Route, Switch } from "react-router";

function App() {
  return (
    <>
      <Nav />
      <Switch>
        <Route exact path="/" component={Homepage}></Route>
      </Switch>
    </>
  );
}

export default App;
